export const navigation = {
    state: {
        authPage: true,
        notePage: false,
        addPage: false,
        eventPage: false,
    },
    mutations:{
        setAuthPage(state){
            state.authPage = true;
            state.notePage = false;
            state.addPage = false;
            state.eventPage = false;
        },
        setNotePage(state){
            state.authPage = false;
            state.notePage = true;
            state.addPage = false;
            state.eventPage = false;
        },        
        setAddPage(state){
            state.authPage = false;
            state.notePage = false;
            state.addPage = true;
            state.eventPage = false;
        },
        setEventPage(state){
            state.authPage = false;
            state.notePage = false;
            state.addPage = false;
            state.eventPage = true;
        },
    },
    namespaced: true,
}
